           <div className="sub-header__wrapper">
                {!noBorder && <span className={`sub-header__border`}>fdsf</span>}
                <h3 style={headerStyles}>{subHeader}</h3>
           </div>
            <p style={contentStyles}>{content}</p>
        </div>
)
